import "./style.css";
import { Link } from "react-router-dom";
import Post from "../Post";

const PostList = ({ posts, addVoteToPost }) => {
  return (
    <ul className="PostList">
      {posts.map((post) => {
        const {
          id,
          title,
          description,
          place,
          votes,
          createdAt,
          idUser,
          voteByLoggedUser,
        } = post;

        return (
          <li key={id}>
            <Link to={`/posts/${id}`}>
              <Post
                id={id}
                title={title}
                description={description}
                place={place}
                votes={votes}
                createdAt={createdAt}
                ownerId={idUser}
                voteByLoggedUser={voteByLoggedUser}
                addVoteToPost={addVoteToPost}
              />
            </Link>
          </li>
        );
      })}
    </ul>
  );
};

export default PostList;
